import React from "react";
import { Link } from "react-router-dom";

function Dashboard() {
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-4">Admin Dashboard</h1>
      <nav className="space-x-4">
        <Link to="/attendance" className="bg-green-500 text-white px-4 py-2 rounded">Mark Attendance</Link>
        <Link to="/reports" className="bg-blue-500 text-white px-4 py-2 rounded">View Reports</Link>
      </nav>
    </div>
  );
}

export default Dashboard;
